import React, { useState } from 'react';
import { Modal } from '@consta/uikit/Modal';
import { TextField } from '@consta/uikit/TextField';
import { Button } from '@consta/uikit/Button';
import { Grid, GridItem } from '@consta/uikit/Grid';
import { Select } from '@consta/uikit/Select';

type CustomerTypeOption = {
  label: string;
  value: string;
};

type AddCustomerModalProps = {
  isOpen: boolean;
  onClose: () => void;
  handlerCreateCustomer: () => void;
  handlerInputChange: (e: React.ChangeEvent<HTMLInputElement>) => void;
};

const customerTypeOptions: CustomerTypeOption[] = [
  { label: 'Юридическое лицо', value: 'organization' },
  { label: 'Физическое лицо', value: 'person' },
];

const AddCustomerModal: React.FC<AddCustomerModalProps> = ({
  isOpen,
  onClose,
  handlerCreateCustomer,
  handlerInputChange,
}) => {
  const [customerCode, setCustomerCode] = useState('');
  const [customerName, setCustomerName] = useState('');
  const [customerINN, setCustomerINN] = useState('');
  const [customerKPP, setCustomerKPP] = useState('');
  const [customerLegalAddress, setCustomerLegalAddress] = useState('');
  const [customerPostalAddress, setCustomerPostalAddress] = useState('');
  const [customerEmail, setCustomerEmail] = useState('');
  const [customerCodeMain, setCustomerCodeMain] = useState('');
  const [customerType, setCustomerType] = useState<CustomerTypeOption | null>(
    customerTypeOptions[0]
  );

  return (
    <Modal isOpen={isOpen} onClose={onClose} style={{ maxWidth: '800px' }}>
      <div style={{ padding: '20px' }}>
        <h3>Добавление нового заказчика </h3>
        <Grid cols={3} gap="m">
          <GridItem>
            <TextField
              label="Код контрагента"
              value={customerCode}
              onChange={handlerInputChange(setCustomerCode, 'customerCode')}
              type="text"
              placeholder="Введите код контрагента"
            />
          </GridItem>
          <GridItem>
            <TextField
              label="Наименование"
              value={customerName}
              onChange={handleInputChange(setCustomerName, 'customerName')}
              type="text"
              placeholder="Введите наименование"
            />
          </GridItem>
          <GridItem>
            <TextField
              label="ИНН"
              value={customerINN}
              onChange={handleInputChange(setCustomerINN, 'customerINN')}
              type="text"
              placeholder="Введите ИНН"
            />
          </GridItem>
          <GridItem>
            <TextField
              label="КПП"
              value={customerKPP}
              onChange={handleInputChange(setCustomerKPP, 'customerKPP')}
              type="text"
              placeholder="Введите КПП"
            />
          </GridItem>
          <GridItem>
            <TextField
              label="Юридический адрес"
              value={customerLegalAddress}
              onChange={handleInputChange(
                setCustomerLegalAddress,
                'customerLegalAddress'
              )}
              type="text"
              placeholder="Введите юридический адрес"
            />
          </GridItem>
          <GridItem>
            <TextField
              label="Почтовый адрес"
              value={customerPostalAddress}
              onChange={handleInputChange(
                setCustomerPostalAddress,
                'customerPostalAddress'
              )}
              type="text"
              placeholder="Введите почтовый адрес"
            />
          </GridItem>
          <GridItem>
            <TextField
              label="Электронная почта"
              value={customerEmail}
              onChange={handleInputChange(setCustomerEmail, 'customerEmail')}
              type="text"
              placeholder="Введите электронную почту"
            />
          </GridItem>
          <GridItem>
            <TextField
              label="Вышестоящий контрагент"
              value={customerCodeMain}
              onChange={handleInputChange(
                setCustomerCodeMain,
                'customerCodeMain'
              )}
              type="text"
              placeholder="Введите код вышестоящего контрагента"
            />
          </GridItem>
          <GridItem>
            <Select
              label="Тип лица"
              placeholder="Выберите тип"
              items={customerTypeOptions}
              value={customerType}
              onChange={(option) => setCustomerType(option)}
              getItemKey={(item) => item.value}
            />
          </GridItem>
          <GridItem>
            <div style={{ display: 'flex', justifyContent: 'space-between' }}>
              <Button label="Добавить" onClick={handlerCreateCustomer} />
              <Button label="Отмена" onClick={onClose} />
            </div>
          </GridItem>
        </Grid>
      </div>
    </Modal>
  );
};

export default AddCustomerModal;
